private static String getURLArguments(Map<String, String[]> map) {
  StringBuilder sb = new StringBuilder();
  for (Entry<String, String[]> entry : map.entrySet()) {
    String key = entry.getKey();
    String[] value = entry.getValue();
    if (sb.length() > 0) {
      sb.append("&");
    }
    sb.append(key);
    sb.append("=");
    sb.append(value[0]);
  }
  return sb.toString();
}
